import styles from './List.module.css'
import SearchInput from './SearchInput.tsx'
import ListOfWork from './ListOfPurposes.tsx'

const List = () => {
    return(
        <div className={styles.list}>
            <SearchInput />
            <ListOfWork />
        </div>
    )
}

export default List
